import React from 'react'
import { ListContanier, Row, Text } from './styles'

function TodoList({ todos }) {
    console.log(todos, "hi");
  return (
    <div>
        <ListContanier>
            {/* render all todos in bullet points*/}
            {todos?.map((todo) => (
                <Row key={todo.id}>
                    <Text>{todo.text}</Text>
                </Row>
            ))}
        </ListContanier>
    </div>
  )
}

export default TodoList
